module.exports = (app) => {
  app.get('/api/clients', auth, async (req, res, next) => {

    Client.find()
      .populate('history')
      .exec()
      .then((clients) => res.status(200).json(clients))
      .catch((err) => next(err));
  });

  app.put('/api/clients/:id', auth, async (req, res, next) => {
    Client.findByIdAndUpdate(req.params.id, req.body)
    .then(() => {
      res.status(200).json(req.body);
    })
    .catch((err) => next(err));
  });

  app.post('/api/clients', auth, async (req, res, next) => {
    const { history, ...rest } = req.body;
    const client = new Client(rest);
    await client.save();

    if (!history) return res.status(200).json(client);

    const app = new History({ ...history, clientId: client._id });
    await app.save();

    client.history.push(app._id);
    await client.save();

    if (!history.emailSent) return res.status(200).json(client);

    // Email
    const startDate = dayjs(history.time);

    const services = await Price.find({
      '_id': { $in: history.serviceIds }
    });

    const serviceList = services.map(item => item.title);

    const person = await Worker.findById(history.worker);

    const texts = {};

    if (history.status === 1) {
      texts.text = `Hallo ${client.name}, \n Ihr Termin wurde gebucht.`;
    } else {
      texts.text = `Hallo ${client.name}, \n La'Nush Laser&BeautyCenter musste Ihren Termin leider stornieren.`;
      texts.footerText = `Buchen Sie gleich einen neuen Termin. Das Team von La'Nush Laser&BeautyCenter freut sich auf Ihren Besuch!`;
    }

    await mailer.sendEmail({
      to: client.email,
      startDate,
      endDate: startDate.add(history.duration, 'm'),
      service: serviceList.join(', '),
      worker: person ? person.name : 'Irgendein',
      ...texts,
    });

    return res.status(200).json(client);
  });
};
